import React from "react";
import ReactDOM from "react-dom";

function Header() {
    return (
        <div className="header">
            <img src="main_logo.svg"/>
            <ul className="nav">
                <li>Pricing</li>
                <li>About</li>
                <li>Content</li>
            </ul>
        </div>
    );
}


function MainContent() {
    return (
        <div>
            <h1>Reasons why i'm exiced to learn React !</h1>
            <ol>
                <li>It's a popular skill so i'm gonna hang out with the cool kids</li>
                <li>It's high appreciate by the companies, maybe a get hired</li>
            </ol>
        </div>
    );
}

function Footer() {
    return (
        <div className="footer">
            <small>Iagorrr development | All rights reserved</small>
        </div>
    );
}

function MyFullPage() {
    return (
        <div>

            <Header/>
            <MainContent/>
            <Footer/>
        </div>
    );
}

ReactDOM.render(<MyFullPage/>, document.getElementById("root"));
